import React, { useState, useEffect } from "react";
import { Link } from "react-scroll";
import logo from "../assets/img/logo.png";
import {
  AiOutlineHolder,
  AiOutlineQrcode,
  AiTwotoneAlert,
} from "react-icons/ai";

export default function Header() {
  const [toggle, setToggle] = useState(false);

  const toggleMenu = () => {
    setToggle(!toggle);
  };
  return (
    <div className="header-container sticky top-0 flex justify-between text-white duration-300 shadow-2xl rounded-br-3xl rounded-bl-3xl bg-[#282847d0] max-w-[1230px] mx-auto flex-row p-3">
      <a href="/">
        <div className="logo border-[#61dafb] border-2 rounded-lg">
          <img src={logo} className="h-[50px]" alt="Logo" />
        </div>
      </a>

      <div className="justify-center items-center translate-y-5">
        <AiTwotoneAlert
          className="duration-300 ease-in-out text-[30px] rounded-3xl"
          id="toggle"
        />
      </div>
      <div className="menu justify-center items-center flex">
        <ul className="hidden md:flex flex-row gap-3 text-white justify-center items-center">
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="about"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">1. </span>About
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="experience"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">2. </span>Experience
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="projects"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">3. </span>Projects
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="contact"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">4. </span>Contact
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 border-[#61dafb] m-2 border-2 hover:text-black hover:bg-[#61dafb] rounded-xl p-2 hover:scale-110 ease-in-out duration-200">
            <a href="https://drive.google.com/file/d/1-yEFuGpNKs_I4T8jfGcyjwh7UFCYblhX/view?usp=sharing">
              Resume
            </a>
          </li>
        </ul>

        <div
          className={`mobile z-999 ${
            toggle
              ? "right-0"
              : "right-[-100%] transition-transform duration-500"
          }`}
        >
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
            <path
              fill="#ffff"
              fill-opacity="1"
              d="M0,288L48,272C96,256,192,224,288,197.3C384,171,480,149,576,165.3C672,181,768,235,864,250.7C960,267,1056,245,1152,250.7C1248,256,1344,288,1392,304L1440,320L1440,320L1392,320C1344,320,1248,320,1152,320C1056,320,960,320,864,320C768,320,672,320,576,320C480,320,384,320,288,320C192,320,96,320,48,320L0,320Z"
            ></path>
          </svg>
          <ul
            className={`fixed md:hidden top-20 z-999 bg-[#61dafb] w-[100%] text-black font-bold ${
              toggle
                ? "right-0 transition-right duration-500"
                : "right-[-100%] transition-right duration-500"
            } h-[100%] gap-3 text-[white] justify-center items-center`}
          >
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="about"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">1. </span>About
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="experience"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">2. </span>Experience
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="projects"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">3. </span>Projects
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="contact"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">4. </span>Contact
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 border-[#61dafb] m-2 border-2 hover:text-black hover:bg-[#61dafb] rounded-xl p-2 hover:scale-110 ease-in-out duration-200">
              <a href="https://drive.google.com/file/d/1-yEFuGpNKs_I4T8jfGcyjwh7UFCYblhX/view?usp=sharing">
                Resume
              </a>
            </li>
          </ul>
        </div>

        <div className="md:hidden">
          {toggle ? (
            <AiOutlineHolder
              onClick={toggleMenu}
              className="text-[#61dafb] text-3xl cursor-pointer block"
            />
          ) : (
            <AiOutlineQrcode
              onClick={toggleMenu}
              className="text-[#61dafb] text-3xl cursor-pointer block"
            />
          )}
        </div>
      </div>
    </div>
  );
}
